import React from 'react';
import Card from '@material-ui/core/Card'; // Importáljuk a Card komponenst
import CardContent from '@material-ui/core/CardContent'; // Importáljuk a CardContent komponenst
import './CSS/Etlap.css';

const Etlap = () => {
  const etelek = [
    { nev: 'Margherita pizza', leiras: 'Paradicsomszósz, mozzarella, bazsalikom, olívaolaj' },
    { nev: 'Carbonara spagetti', leiras: 'Tojás, parmezán sajt, guanciale, bors' },
    { nev: 'Tiramisu', leiras: 'Tojás, cukor, mascarpone, savoiardi, kávé, kakaópor' },
  ];

  return (
    <div className='Etlap'>
      <h1>Étlap</h1>
      <Card style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}> {/* Hozzáadjuk a Card komponenst és a flex tulajdonságokat */}
        {etelek.map((etel, index) => (
          <CardContent key={index}> {/* A CardContent komponenst használjuk az etelek megjelenítéséhez */}
            <h2>{etel.nev}</h2>
            <p>{etel.leiras}</p>
          </CardContent>
        ))}
      </Card>
      <footer className='footer'>
        <p>&copy; {new Date().getFullYear()} FoodRapid. Minden jog fenntartva.</p>
        <p>Kövess minket a közösségi médiában!</p>
      </footer>
    </div>
  );
};

export default Etlap;
